import axios from 'axios';
export const registerUser = (login, full_name, email, password) => axios.post("http://127.0.0.1:3001/api/auth/register/", {
  login: login,
  full_name: full_name,
  email: email,
  password: password
}, {
  withCredentials: true,
  headers: {
    'Access-Control-Allow-Origin': '*',
    'Content-Type': 'application/json'
  }
});
export const loginn = (email, login, password) => axios.post("http://127.0.0.1:3001/api/auth/login/", {
  email: email,
  login: login,
  password: password
});
